import React from "react"

import Header from "./components/Header"

class App extends React.Component {
  text = "Help text"
  render () {
    return (
      <div className="name">
        <Header title="Header" />
        <h1>{this.text}</h1>
        <input placeholder={this.text} />
        <p onClick={this.inputClick}>{this.text}</p>
      </div>
    )
  }

  inputClick() {
    this.text = "changed"
    console.log("clicked")
  }

}

export default App
